shaders.vertex:
// Copyright (c) 2013 Oliver Lau <ola@ct.de>, Heise Zeitschriften Verlag
// All rights reserved.

attribute vec4 aVertex;
attribute vec4 aTexCoord;
varying vec4 vTexCoord;

void main(void)
{
    vTexCoord.x = aTexCoord.x;
    vTexCoord.y = 1.0 - aTexCoord.y;
    gl_Position = aVertex;
}

shaders.fragment:
// Copyright (c) 2013 Oliver Lau <ola@ct.de>, Heise Zeitschriften Verlag
// All rights reserved.

varying vec4 vTexCoord;
uniform sampler2D uTexture;
uniform float uT;
uniform vec2 uResolution;
uniform vec2 uMouse;
uniform float uStitchSize; // 0, 20, 7
uniform bool uInvert; // true
uniform int uSpeed; // 1, 10, 5

vec4 crosshatch(sampler2D tex, vec2 uv, vec2 resolution, float stitchSize, bool invert)
{
  vec4 c = vec4(0.0);
  vec2 cPos = uv * resolution;
  vec2 tlPos = floor(cPos / vec2(stitchSize, stitchSize));
  tlPos *= stitchSize;
  int remX = int(mod(cPos.x, stitchSize));
  int remY = int(mod(cPos.y, stitchSize));
  if (remX == 0 && remY == 0)
    tlPos = cPos;
  vec2 blPos = tlPos;
  blPos.y += (stitchSize - 1.0);
  if ((remX == remY) || 
     (((int(cPos.x) - int(blPos.x)) == (int(blPos.y) - int(cPos.y))))) 
  {
    if (invert)
      c = vec4(0.2, 0.15, 0.05, 1.0);
    else
      c = texture2D(tex, tlPos * vec2(1.0, 1.0) / resolution) * 1.4;
  }
  else {
    if (invert)
      c = texture2D(tex, tlPos * vec2(1.0, 1.0) / resolution) * 1.4;
    else
      c = vec4(0.0, 0.0, 0.0, 1.0);
  }
  return c;
}

void main(void)
{
  vec2 d = uMouse / uResolution;
  float lightness = 1.0;
  float pulsestrength =  d.y;
  vec4 color = crosshatch(uTexture, vTexCoord.st, uResolution, uStitchSize, uInvert);
  gl_FragColor = lightness * vec4(1.0, 0.5 + pulsestrength * sin(float(uSpeed) * uT), 1.0, 1.0) * color;
}
